import React, { Component } from 'react'
import './signup.css'

class signup extends Component {

    render() {
        return (
            <div>
            <div class="bg-image"></div>

            <div class="bg-text">
                <h1>I am John Doe</h1>
                <p>And I'm a Photographer</p>
            </div>
            </div>
        );
    }

}


export default signup
